import React, {Component} from 'react';
import h1Components from './component'
class App extends Component{
    
    render(){
        var namesArray = ["ivica", "pedza", "vesna", "dekso"]
        const h1Component = namesArray.map((item) => <h1Components key={item} value={item} />);
        
       
        return (
            <div className="mainDiv container-fluid text-center justify-content-center">
                <div className="row">
                    <div className="col-6">
                    return <h1Component />
                    </div> 
                    <div className="col-6">
                    {this.props.value}
                    </div>
                </div>
            </div>
        )
    }
}

export default App;
